import './App.css';

const Task = (value) => {
  return (
    <div>
      <li>{'Exame'}</li>,
      <li>{'Contadora'}</li>,
      <li>{'Curtida insta ropi'}</li>,
      <li>{'Estudar'}</li>,
    </div>
  );
}

function App() {
  return (
    <Task />
  );
}

export default App;
